'''Darts''' are a type of [[members only]] [[Ranged]] [[throwing weapon]]. They can be created by members with the [[Smithing]] and [[Fletching]] skills once the player has completed the [[Tourist Trap]] quest. They are made from [[dart tip]]s and [[feather]]s and have an attack range of 3 tiles, 5 with longrange. They can be [[poison]]ed and are one-handed, so they can be wielded along with a [[shield]] or [[god book]] for protection.

Darts, alongside [[throwing knives]], are the fastest [[ranged weapons]] in the game making them a fairly popular weapon to train Ranged with.

Unpoisoned darts may be used to load a [[toxic blowpipe]] as [[ammunition]], which increases ranged accuracy (+30) and ranged strength (+20) as well as a 25% chance to [[envenom]] the target.

